import React, { Component } from "react";
import photo from "../images/test-image.png";
import ListGroup from "react-bootstrap/ListGroup";

class Contact extends Component {
  state = {};
  render() {
    return (
      <div className="header">
        <img className="photo" src={photo} alt="Gregg Van Orden" />
        <ListGroup>
          <ListGroup.Item>709 Albemarle St. Wyckoff NJ 07481</ListGroup.Item>
          <ListGroup.Item>(201) 321 - 8040</ListGroup.Item>
          <ListGroup.Item className="email">gvanorden@gmail.com</ListGroup.Item>
          <ListGroup.Item>
            <a href="https://github.com/gvanorden" target="_blank">
              Github Repositories
            </a>
          </ListGroup.Item>
          <ListGroup.Item>
            <a href="https://vanordenrealty.com" target="_blank">
              Van Orden Realty Website
            </a>
          </ListGroup.Item>
        </ListGroup>
      </div>
    );
  }
}

export default Contact;
